    name: string;
    value: any;
    filterBy?: string;
    onClick?: any;
}


const FilterButton: FC<FiletrButtonProps> = ({name, value, onClick, filterBy}) => {
    return (
        <button value={value} onClick = {event => onClick(event.target)}>{name}
        </button>
    )
}

